script: |
  super -f tsv -I q10692.sql | sort > q10692.out

vector: true

inputs:
  - name: q10692.sql
    data: |
      SELECT + CAST ( - + MIN ( NULLIF ( + - 48, col2 ) ) AS INTEGER ) FROM tab2 AS cor0 GROUP BY col0, col2 HAVING NOT - + 44 + + col0 / - + col0 IS NULL;
  - name: tab2

outputs:
  - name: q10692.out
    data: |
      48
      48
      48
